import './App.css';
import Nav from './components/nav';
import Register from './components/register';
import Home from './components/home';
import Login from './components/login';
import privateComponent from './components/privateComponent';
import { BrowserRouter,Routes,Route } from 'react-router-dom';

function App() {
  return (
    <div className='App'>
      <BrowserRouter>
        <Nav />
        <Routes>
          <Route path='/' element={<Home/>}></Route>
          <Route path='/login' element={<Login/>}></Route>
          <Route path='/register' element={<Register/>}></Route>
          <Route path='/logout' element={<h1>Logout component</h1>}></Route>
          <Route path='/planner' element={<h1>Planner component</h1>}></Route>
          <Route path='/store' element={<h1>Store component</h1>}></Route>
          <Route path='/notes' element={<h1>Notes component</h1>}></Route>
          <Route path='/practice' element={<h1>Practice component</h1>}></Route>
          <Route path='/profile' element={<h1>Profile component</h1>}></Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
